 ('295', '2831', '10', '1', 'en_us', '3', '', '{\"typeId\":\"10\",\"authorId\":null,\"title\":\"How We Help\",\"slug\":\"how-we-help\",\"postDate\":1485364513,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"74\":{\"new1\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Sign Up\",\"stepContent\":\"<p>You can register to become an EdNavigator member through your employer, a participating community organization, or our website. Members can receive help with their child\\u2019s education or with their own learning goals.<\\/p>\"}},\"new2\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Review Records\",\"stepContent\":\"<p>After registering, you\\u2019ll be connected to a Navigator&mdash;if you\\u2019re a parent, we\\u2019ll work together to create a path to success for your child. If you\\u2019re an adult learner, we\\u2019ll get to work helping you further your education.<\\/p>\"}},\"new3\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Make a Plan\",\"stepContent\":\"<p>Your Navigator will help you set clear short- and long-term goals, from getting your child into college to helping you get a degree while balancing work and life. Then together, you\\u2019ll create a concrete plan for achieving those goals.<\\/p>\"}},\"new4\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Take Action\",\"stepContent\":\"<p>Your Navigator will offer direct, hands-on assistance to help you turn your plans into reality&mdash;that may include going with you to school meetings, teaching effective study habits, or connecting you to available community resources.<\\/p>\"}},\"new5\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Stay on Track\",\"stepContent\":\"<p>As students progress, EdNavigator will be there every step of the way&mdash;whatever new challenges or opportunities arise, we\\u2019re here to support and keep our member families on track to reach their goals.<span><\\/span><\\/p>\"}}},\"71\":{\"new1\":{\"type\":\"contentSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Stronger Schools,\\r\\nStronger Communities\",\"sectionContent\":\"<p>Our priority is helping you get the education you want for yourself and your family. Through our work, we also strive to strengthen local schools and communities in a way that benefits everyone.&nbsp;<\\/p>\"}},\"new2\":{\"type\":\"contentSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Shining a Spotlight \\r\\non Family Needs\",\"sectionContent\":\"<p>We\\u2019re always sharing new information and resources that help families stay on track while encouraging schools to be more responsive to student and parent needs. <a href=\\\"http:\\/\\/ednavigator.dev\\/who-we-are#entry:2830\\\">Read more about what we\\u2019re learning<\\/a>.<span><\\/span><\\/p>\"}}},\"68\":{\"new1\":{\"type\":\"navigatorsInfoSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Personal, Professional Guidance\",\"sectionContent\":\"<p>Our Navigators combine expert knowledge of schools with a deep understanding of our communities. Most are accomplished former teachers, school leaders, or counselors, and all have passed a background check, received privacy training and adhere to a strict code of confidentiality.&nbsp;<\\/p>\\r\\n<p>They\\u2019re like pediatricians for your educational health, and they\\u2019re always looking out for your best interests.<\\/p>\"}},\"new2\":{\"type\":\"navigatorsInfoSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Help that Finds You\",\"sectionContent\":\"<p>Your Navigator will meet with you at your worksite&mdash;or wherever is most convenient for you&mdash;to develop a customized educational plan. They\\u2019ll help:&nbsp;<\\/p>\\r\\n<ul><li>Set clear learning goals<\\/li><li>Choose the right school and explore financial options<\\/li><li>Communicate with teachers and administrators<\\/li><li>Analyze grades and progress<\\/li><li>Answer your questions via phone, text, or email whenever you need advice<\\/li><\\/ul>\\r\\n\"}}},\"48\":\"We give hard-working families personalized, ongoing support along the path from preschool to college.\",\"7\":\"\",\"6\":\"\"}}', '2017-01-25 20:35:32', '2017-01-25 20:35:32', '9a9536fb-be36-4129-82dc-9d44052f374a'),
 ('296', '2831', '10', '1', 'en_us', '4', '', '{\"typeId\":\"10\",\"authorId\":null,\"title\":\"How We Help\",\"slug\":\"how-we-help\",\"postDate\":1485364513,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"77\":\"<p><a href=\\\"\\/resources\\\">Resources for Families<\\/a><\\/p>\",\"74\":{\"2918\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Sign Up\",\"stepContent\":\"<p>You can register to become an EdNavigator member through your employer, a participating community organization, or our website. Members can receive help with their child\\u2019s education or with their own learning goals.<\\/p>\"}},\"2919\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Review Records\",\"stepContent\":\"<p>After registering, you\\u2019ll be connected to a Navigator&mdash;if you\\u2019re a parent, we\\u2019ll work together to create a path to success for your child. If you\\u2019re an adult learner, we\\u2019ll get to work helping you further your education.<\\/p>\"}},\"2920\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Make a Plan\",\"stepContent\":\"<p>Your Navigator will help you set clear short- and long-term goals, from getting your child into college to helping you get a degree while balancing work and life. Then together, you\\u2019ll create a concrete plan for achieving those goals.<\\/p>\"}},\"2921\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Take Action\",\"stepContent\":\"<p>Your Navigator will offer direct, hands-on assistance to help you turn your plans into reality&mdash;that may include going with you to school meetings, teaching effective study habits, or connecting you to available community resources.<\\/p>\"}},\"2922\":{\"type\":\"step\",\"enabled\":\"1\",\"fields\":{\"stepTitle\":\"Stay on Track\",\"stepContent\":\"<p>As students progress, EdNavigator will be there every step of the way&mdash;whatever new challenges or opportunities arise, we\\u2019re here to support and keep our member families on track to reach their goals.<\\/p>\"}}},\"71\":{\"2923\":{\"type\":\"contentSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Stronger Schools,\\r\\nStronger Communities\",\"sectionContent\":\"<p>Our priority is helping you get the education you want for yourself and your family. Through our work, we also strive to strengthen local schools and communities in a way that benefits everyone.&nbsp;<\\/p>\"}},\"2924\":{\"type\":\"contentSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Shining a Spotlight \\r\\non Family Needs\",\"sectionContent\":\"<p>We\\u2019re always sharing new information and resources that help families stay on track while encouraging schools to be more responsive to student and parent needs. <a href=\\\"http:\\/\\/ednavigator.dev\\/who-we-are#entry:2830:url\\\">Read more about what we\\u2019re learning<\\/a>.<\\/p>\"}}},\"68\":{\"2916\":{\"type\":\"navigatorsInfoSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Personal, Professional Guidance\",\"sectionContent\":\"<p>Our Navigators combine expert knowledge of schools with a deep understanding of our communities. Most are accomplished former teachers, school leaders, or counselors, and all have passed a background check, received privacy training and adhere to a strict code of confidentiality.&nbsp;<\\/p>\\r\\n<p>They\\u2019re like pediatricians for your educational health, and they\\u2019re always looking out for your best interests.<\\/p>\"}},\"2917\":{\"type\":\"navigatorsInfoSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Help that Finds You\",\"sectionContent\":\"<p>Your Navigator will meet with you at your worksite&mdash;or wherever is most convenient for you&mdash;to develop a customized educational plan. They\\u2019ll help:&nbsp;<\\/p>\\r\\n<ul><li>Set clear learning goals<\\/li><li>Choose the right school and explore financial options<\\/li><li>Communicate with teachers and administrators<\\/li><li>Analyze grades and progress<\\/li><li>Answer your questions via phone, text, or email whenever you need advice<\\/li><\\/ul>\"}}},\"48\":\"We give hard-working families personalized, ongoing support along the path from preschool to college.\",\"7\":\"\",\"6\":\"\"}}', '2017-01-25 21:51:39', '2017-01-25 21:51:39', '5a73bcef-92b0-44f0-9282-5aaa9510045d'),
