ere every step of the way&mdash;whatever new challenges or opportunities arise, we\\u2019re here to support and keep our member families on track to reach their goals.<\\/p>\"}}},\"71\":{\"2923\":{\"type\":\"contentSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Stronger Schools,\\r\\nStronger Communities\",\"sectionContent\":\"<p>Our priority is helping you get the education you want for yourself and your family. Through our work, we also strive to strengthen local schools and communities in a way that benefits everyone.&nbsp;<\\/p>\"}},\"2924\":{\"type\":\"contentSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Shining a Spotlight \\r\\non Family Needs\",\"sectionContent\":\"<p>We\\u2019re always sharing new information and resources that help families stay on track while encouraging schools to be more responsive to student and parent needs. <a href=\\\"http:\\/\\/ednavigator.dev\\/who-we-are#entry:2830:url\\\">Read more about what we\\u2019re learning<\\/a>.<\\/p>\"}}},\"68\":{\"2916\":{\"type\":\"navigatorsInfoSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Personal, Professional Guidance\",\"sectionContent\":\"<p>Our Navigators combine expert knowledge of schools with a deep understanding of our communities. Most are accomplished former teachers, school leaders, or counselors, and all have passed a background check, received privacy training and adhere to a strict code of confidentiality.&nbsp;<\\/p>\\r\\n<p>They\\u2019re like pediatricians for your educational health, and they\\u2019re always looking out for your best interests.<\\/p>\"}},\"2917\":{\"type\":\"navigatorsInfoSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Help that Finds You\",\"sectionContent\":\"<p>Your Navigator will meet with you at your worksite&mdash;or wherever is most convenient for you&mdash;to develop a customized educational plan. They\\u2019ll help:&nbsp;<\\/p>\\r\\n<ul><li>Set clear learning goals<\\/li><li>Choose the right school and explore financial options<\\/li><li>Communicate with teachers and administrators<\\/li><li>Analyze grades and progress<\\/li><li>Answer your questions via phone, text, or email whenever you need advice<\\/li><\\/ul>\"}}},\"48\":\"We give hard-working families personalized, ongoing support along the path from preschool to college.\",\"7\":\"\",\"6\":\"\"}}', '2017-01-26 16:38:33', '2017-01-26 16:38:33', 'ecea94d8-43e9-4bcb-88f3-22f3be1842c4'),
 ('298', '2', '1', '1', 'en_us', '22', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1483481267,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"50\":[\"2871\"],\"49\":\"<p>We partner with leading businesses to help hard-working families find a path \\r\\nto success in school and beyond.<\\/p>\",\"48\":\"Education is \\r\\nthe path to a better life\",\"7\":\"\",\"6\":\"\",\"51\":{\"2868\":{\"type\":\"userPath\",\"enabled\":\"1\",\"fields\":{\"pathTitle\":\"For\\r\\nEmployers\",\"pathLinkText\":\"Invest in your greatest \\r\\nasset \\u2014 your people.\",\"pathPage\":[\"2893\"],\"pathImage\":[\"2866\"]}},\"2869\":{\"type\":\"userPath\",\"enabled\":\"1\",\"fields\":{\"pathTitle\":\"For Families\\r\\n& Students\",\"pathLinkText\":\"Find your path.\",\"pathPage\":[\"2892\"],\"pathImage\":[\"2867\"]}}}}}', '2017-01-26 16:52:05', '2017-01-26 16:52:05', 'f42803a2-0f65-47a2-a977-136252baf2b1'),
 ('299', '2830', '9', '1', 'en_us', '3', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Who We Are\",\"slug\":\"who-we-are\",\"postDate\":1482262860,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"78\":{\"new1\":{\"type\":\"introSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Who are we?\",\"sectionText\":\"<p>We\\u2019re teachers. We\\u2019re principals. We\\u2019re counselors and coaches. We\\u2019re policy experts and data analysts and community anchors. Most of all, we\\u2019re moms and dads who know how hard it can be to figure out schools and keep kids on track, no matter who you are or where you live.&nbsp;<\\/p>\"}},\"new2\":{\"type\":\"introSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Our Mission\",\"sectionText\":\"<p>We founded EdNavigator because we believe that education is the path to a better life. But navigating schools and education systems isn\\u2019t easy. The stakes are high, and there are so many questions, deadlines, and decisions along the way. That\\u2019s why we\\u2019re here&mdash;so you don\\u2019t have to do it all alone.<\\/p>\"}}},\"77\":\"\",\"48\":\"We\\u2019re a nonprofit organization working to help busy families and students achieve their educational dreams. \",\"7\":\"\",\"6\":\"\"}}', '2017-01-26 20:12:10', '2017-01-26 20:12:10', '1843f9a0-c70d-4939-899b-2c4c895f3fc3'),
