 ('303', '2830', '9', '1', 'en_us', '7', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Who We Are\",\"slug\":\"who-we-are\",\"postDate\":1482262860,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"78\":{\"2926\":{\"type\":\"introSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Who are we?\",\"sectionContent\":\"<p>We\\u2019re teachers. We\\u2019re principals. We\\u2019re counselors and coaches. We\\u2019re policy experts and data analysts and community anchors. Most of all, we\\u2019re moms and dads who know how hard it can be to figure out schools and keep kids on track, no matter who you are or where you live.&nbsp;<\\/p>\"}},\"2927\":{\"type\":\"introSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Our Mission\",\"sectionContent\":\"<p>We founded EdNavigator because we believe that education is the path to a better life. But navigating schools and education systems isn\\u2019t easy. The stakes are high, and there are so many questions, deadlines, and decisions along the way. That\\u2019s why we\\u2019re here&mdash;so you don\\u2019t have to do it all alone.<\\/p>\"}}},\"77\":\"\",\"48\":\"We\\u2019re a nonprofit organization working to help busy families and students achieve their educational dreams. \",\"44\":{\"2929\":{\"type\":\"principle\",\"enabled\":\"1\",\"fields\":{\"principleIcon\":[\"2925\"],\"principleLabel\":\"You always come first\",\"principleDescription\":\"We always put the needs of families and students first. We represent no one\\u2019s interests but yours. Ever\"}},\"2931\":{\"type\":\"principle\",\"enabled\":\"1\",\"fields\":{\"principleIcon\":[\"2930\"],\"principleLabel\":\"We put you in charge\",\"principleDescription\":\"We provide guidance and honest advice, but you set the course. We never act without your permission or make choices for you. Our job is to help you get what you want. \"}}},\"7\":\"\",\"6\":\"\"}}', '2017-01-26 23:16:07', '2017-01-26 23:16:07', '398f1495-0073-4b25-9f26-76b667de70