 ('304', '2830', '9', '1', 'en_us', '8', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Who We Are\",\"slug\":\"who-we-are\",\"postDate\":1482262860,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"78\":{\"2926\":{\"type\":\"introSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Who are we?\",\"sectionContent\":\"<p>We\\u2019re teachers. We\\u2019re principals. We\\u2019re counselors and coaches. We\\u2019re policy experts and data analysts and community anchors. Most of all, we\\u2019re moms and dads who know how hard it can be to figure out schools and keep kids on track, no matter who you are or where you live.&nbsp;<\\/p>\"}},\"2927\":{\"type\":\"introSection\",\"enabled\":\"1\",\"fields\":{\"sectionTitle\":\"Our Mission\",\"sectionContent\":\"<p>We founded EdNavigator because we believe that education is the path to a better life. But navigating schools and education systems isn\\u2019t easy. The stakes are high, and there are so many questions, deadlines, and decisions along the way. That\\u2019s why we\\u2019re here&mdash;so you don\\u2019t have to do it all alone.<\\/p>\"}}},\"77\":\"\",\"48\":\"We\\u2019re a nonprofit organization working to help busy families and students achieve their educational dreams. \",\"44\":{\"2929\":{\"type\":\"principle\",\"enabled\":\"1\",\"fields\":{\"principleIcon\":[\"2925\"],\"principleLabel\":\"You always come first\",\"principleDescription\":\"We always put the needs of families and students first. We represent no one\\u2019s interests but yours. Ever\"}},\"2931\":{\"type\":\"principle\",\"enabled\":\"1\",\"fields\":{\"principleIcon\":[\"2930\"],\"principleLabel\":\"We put you in charge\",\"principleDescription\":\"We provide guidance and honest advice, but you set the course. We never act without your permission or make choices for you. Our job is to help you get what you want. \"}},\"new1\":{\"type\":\"principle\",\"enabled\":\"1\",\"fields\":{\"principleIcon\":[\"2933\"],\"principleLabel\":\"We treat you like family\",\"principleDescription\":\"We share your sense of urgency. We respond quickly, take your concerns seriously, and always treat you with dignity and respect. Your problems are our problems.\"}},\"new2\":{\"type\":\"principle\",\"enabled\":\"1\",\"fields\":{\"principleIcon\":[\"2934\"],\"principleLabel\":\"We find a way\",\"principleDescription\":\"We don\\u2019t let systems, processes, paperwork or unwritten rules get in the way of doing right by a family or student. We find a way to make it happen.\"}},\"new3\":{\"type\":\"principle\",\"enabled\":\"1\",\"fields\":{\"principleIcon\":[\"2935\"],\"principleLabel\":\"We protect your privacy\",\"principleDescription\":\"We maintain best-in-class privacy controls to protect you. We never share information about you or your children without your consent. \"}},\"new4\":{\"type\":\"principle\",\"enabled\":\"1\",\"fields\":{\"principleIcon\":[\"2936\"],\"principleLabel\":\"We level the playing field\",\"principleDescription\":\"We champion the right of all families to an excellent education, especially those who have faced disadvantages in the past.\"}}},\"7\":\"\",\"6\":\"\"}}', '2017-01-26 23:47:39', '2017-01-26 23:47:39', 'd17cd94e-2928-4032-8704-6dca9b2382b0'),
 ('305', '2845', '9', '1', 'en_us', '2', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Leadership\",\"slug\":\"leadership\",\"postDate\":1482273600,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"2830\",\"fields\":{\"48\":\"Our leadership team has nearly 60 years of combined experience in education at all levels, from leading classrooms to shaping federal policy.\",\"36\":{\"2846\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Timothy Daly\",\"personTitle\":\"Founding Partner\",\"bio\":\"\",\"photo\":\"\"}},\"2847\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Whitney Henderson\",\"personTitle\":\"Navigator-in-chief\",\"bio\":\"\",\"photo\":\"\"}},\"2848\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"David Keeling\",\"personTitle\":\"Founding Partner\",\"bio\":\"\",\"photo\":\"\"}},\"2849\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Ariela Rozman\",\"personTitle\":\"Founding Partner\",\"bio\":\"\",\"photo\":\"\"}}},\"7\":\"\",\"6\":\"\"}}', '2017-01-30 17:43:59', '2017-01-30 17:43:59', 'a437c1b5-30b1-4eda-9ab8-4006185b9802'),
 ('306', '2845', '9', '1', 'en_us', '3', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Leadership\",\"slug\":\"leadership\",\"postDate\":1482273600,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"2830\",\"fields\":{\"48\":\"Our leadership team has nearly 60 years of combined experience in education at all levels, from leading classrooms to shaping federal policy.\",\"36\":{\"2846\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Timothy Daly\",\"personTitle\":\"Founding Partner\",\"personDescription\":\"<p>Tim brings 17 years of experience in public education to EdNavigator, including service as an urban school teacher, organizational leader, and policy expert. Prior to founding EdNavigator, he served alongside Ariela Rozman as President of TNTP, a leading education nonprofit organization that partners with school systems and states to ensure that all students get excellent teachers. During his eight years in that role, TNTP became a leading source of innovative research and a respected independent voice on teacher quality issues. Before joining TNTP in 2001, Tim taught social studies at Northeast Middle School in Baltimore. He holds a MA in Teaching from Johns Hopkins University and a BA in American Studies from Northwestern University. He lives in Chicago with his wife and two children.<\\/p>\",\"personImage\":\"\"}},\"2847\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Whitney Henderson\",\"personTitle\":\"Navigator-in-chief\",\"personDescription\":\"<p>A native of East St. Louis, IL, Whitney brings to her work 10 years of experience as an award-winning teacher, school principal and instructional expert. Her career in education began in New Orleans, where she moved after Hurricane Katrina to become a founding teacher and eventually 7th-9th grade principal at KIPP Central City Academy. Her extraordinary success with students earned her the 2011 Fishman Prize, a $25,000 award given annually to just four teachers nationwide. Whitney holds a BA in English and Modern Foreign Languages from Jackson State University, a MA in Organizational Leadership from Teacher\\u2019s College at Columbia University, and a Master\\u2019s in Education Policy and Management from the Harvard Graduate School of Education. She lives in New Orleans, LA.&nbsp;<\\/p>\",\"personImage\":\"\"}},\"2848\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"David Keeling\",\"personTitle\":\"Founding Partner\",\"personDescription\":\"<p>David Keeling has 16 years of experience in strategic communications and public education. Over the last decade and a half, his words have appeared in teacher recruitment ads in the New York City subway, in news outlets from Education Week to The New York Times, and in the remarks and messages of some of the nation\\u2019s most prominent education leaders. Before EdNavigator, he served for six years as Vice President of Communications for TNTP, leading the organization\\u2019s communications, marketing and publications strategy and advising TNTP staff, state education agencies and urban school systems nationwide on communicating with teachers, parents, school leaders, and other stakeholders.&nbsp; He holds a BA in English from Middlebury College and lives with his wife and two children in Chicago.<\\/p>\",\"personImage\":\"\"}},\"2849\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Ariela Rozman\",\"personTitle\":\"Founding Partner\",\"personDescription\":\"<p>Before founding EdNavigator, Ariela Rozman served for eight years as Chief Executive Officer of TNTP. Under her tenure as CEO, TNTP tripled in size, growing to a staff of 370 full-time employees across 41 states and an annual budget of more than $60 million.&nbsp; Today, TNTP has a presence in more than 50 cities and states, including most of the country\\u2019s largest urban areas. In 2012, she and then-TNTP President Tim Daly received the Harold W. McGraw, Jr. Prize in Education for their leadership. Prior to joining TNTP in 2001, Ariela worked in consulting for Bain & Company and helped launch and grow the e-commerce site PlanetRx.com. She holds a BA in Political and Social Thought from the University of Virginia and lives in Brooklyn, NY with her husband and two children.<\\/p>\",\"personImage\":\"\"}}},\"81\":\"Our Leadership Team\",\"7\":\"\",\"6\":\"\"}}', '2017-01-30 18:40:34', '2017-01-30 18:40:34', '1b51794a-9cd2-468a-8bcf-dc46948562d2'),
 ('307', '2845', '9', '1', 'en_us', '4', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Leadership\",\"slug\":\"leadership\",\"postDate\":1482273600,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"2830\",\"fields\":{\"48\":\"Our leadership team has nearly 60 years of combined experience in education at all levels, from leading classrooms to shaping federal policy.\",\"36\":{\"2846\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Timothy Daly\",\"personTitle\":\"Founding Partner\",\"personDescription\":\"<p>Tim brings 17 years of experience in public education to EdNavigator, including service as an urban school teacher, organizational leader, and policy expert. Prior to founding EdNavigator, he served alongside Ariela Rozman as President of TNTP, a leading education nonprofit organization that partners with school systems and states to ensure that all students get excellent teachers. During his eight years in that role, TNTP became a leading source of innovative research and a respected independent voice on teacher quality issues. Before joining TNTP in 2001, Tim taught social studies at Northeast Middle School in Baltimore. He holds a MA in Teaching from Johns Hopkins University and a BA in American Studies from Northwestern University. He lives in Chicago with his wife and two children.<\\/p>\",\"personImage\":[\"2941\"]}},\"2847\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Whitney Henderson\",\"personTitle\":\"Navigator-in-chief\",\"personDescription\":\"<p>A native of East St. Louis, IL, Whitney brings to her work 10 years of experience as an award-winning teacher, school principal and instructional expert. Her career in education began in New Orleans, where she moved after Hurricane Katrina to become a founding teacher and eventually 7th-9th grade principal at KIPP Central City Academy. Her extraordinary success with students earned her the 2011 Fishman Prize, a $25,000 award given annually to just four teachers nationwide. Whitney holds a BA in English and Modern Foreign Languages from Jackson State University, a MA in Organizational Leadership from Teacher\\u2019s College at Columbia University, and a Master\\u2019s in Education Policy and Management from the Harvard Graduate School of Education. She lives in New Orleans, LA.&nbsp;<\\/p>\",\"personImage\":\"\"}},\"2848\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"David Keeling\",\"personTitle\":\"Founding Partner\",\"personDescription\":\"<p>David Keeling has 16 years of experience in strategic communications and public education. Over the last decade and a half, his words have appeared in teacher recruitment ads in the New York City subway, in news outlets from Education Week to The New York Times, and in the remarks and messages of some of the nation\\u2019s most prominent education leaders. Before EdNavigator, he served for six years as Vice President of Communications for TNTP, leading the organization\\u2019s communications, marketing and publications strategy and advising TNTP staff, state education agencies and urban school systems nationwide on communicating with teachers, parents, school leaders, and other stakeholders.&nbsp; He holds a BA in English from Middlebury College and lives with his wife and two children in Chicago.<\\/p>\",\"personImage\":\"\"}},\"2849\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Ariela Rozman\",\"personTitle\":\"Founding Partner\",\"personDescription\":\"<p>Before founding EdNavigator, Ariela Rozman served for eight years as Chief Executive Officer of TNTP. Under her tenure as CEO, TNTP tripled in size, growing to a staff of 370 full-time employees across 41 states and an annual budget of more than $60 million.&nbsp; Today, TNTP has a presence in more than 50 cities and states, including most of the country\\u2019s largest urban areas. In 2012, she and then-TNTP President Tim Daly received the Harold W. McGraw, Jr. Prize in Education for their leadership. Prior to joining TNTP in 2001, Ariela worked in consulting for Bain & Company and helped launch and grow the e-commerce site PlanetRx.com. She holds a BA in Political and Social Thought from the University of Virginia and lives in Brooklyn, NY with her husband and two children.<\\/p>\",\"personImage\":\"\"}}},\"81\":\"Our Leadership Team\",\"7\":\"\",\"6\":\"\"}}', '2017-01-30 22:23:15', '2017-01-30 22:23:15', '7080cfbc-cda0-4185-8bca-9f2824845dbe'),
 ('308', '2850', '9', '1', 'en_us', '2', '', '{\"typeId\":\"15\",\"authorId\":\"1\",\"title\":\"Board of Directors\",\"slug\":\"board-of-directors\",\"postDate\":1482274140,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"2830\",\"fields\":{\"48\":\"Our Board of Directors broadens our perspective while helping us keep our eyes on the ball.\",\"36\":{\"2851\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Kriste Dragon\",\"personTitle\":\"Co-founder and Chief Executive Officer, Citizens of the World Charter Schools\",\"personDescription\":\"\",\"personImage\":\"\"}},\"2852\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Kaya Henderson\",\"personTitle\":\"Former Chancellor,  DC Public Schools\",\"personDescription\":\"\",\"personImage\":\"\"}},\"2853\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Ryan Smith\",\"personTitle\":\"Executive Director,  Education Trust-West\",\"personDescription\":\"\",\"personImage\":\"\"}},\"2854\":{\"type\":\"person\",\"enabled\":\"1\",\"fields\":{\"personName\":\"Chris Stewart\",\"personTitle\":\"Director of Outreach and External Affairs, Education Post\",\"personDescription\":\"\",\"personImage\":\"\"}}},\"81\":\"\",\"7\":\"\",\"6\":\"\"}}', '2017-01-30 23:17:17', '2017-01-30 23:17:17', '6e8e359e-8787-4153-b33a-f041a0ba2ffb'),
