INSERT INTO `craft_matrixcontent_introsections` (`id`, `elementId`, `locale`, `field_introSection_sectionTitle`, `field_introSection_sectionContent`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '2926', 'en_us', 'Who are we?', '<p>We’re teachers. We’re principals. We’re counselors and coaches. We’re policy experts and data analysts and community anchors. Most of all, we’re moms and dads who know how hard it can be to figure out schools and keep kids on track, no matter who you are or where you live. </p>', '2017-01-26 20:12:10', '2017-01-26 23:47:39', 'ef94a60b-2a0c-47af-8044-14197ae2fe5c'),
 ('2', '2927', 'en_us', 'Our Mission', '<p>We founded EdNavigator because we believe that education is the path to a better life. But navigating schools and education systems isn’t easy. The stakes are high, and there are so many questions, deadlines, and decisions along the way. That’s why we’re here—so you don’t have to do it all alone.</p>', '2017-01-26 20:12:10', '2017-01-26 23:47:39', 'a23e38b8-1976-44af-9dcd-ca56622a94b8');
INSERT INTO `craft_matrixcontent_knowledge` (`id`, `elementId`, `locale`, `field_contentSection_sectionTitle`, `field_contentSection_sectionContent`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '2923', 'en_us', 'Stronger Schools,\r\nStronger Communities', '<p>Our priority is helping you get the education you want for yourself and your family. Through our work, we also strive to strengthen local schools and communities in a way that benefits everyone. </p>', '2017-01-25 20:35:32', '2017-01-26 16:38:33', 'db66cd5e-b240-4579-adfe-4a3a2ce7c8d6'),
 ('2', '2924', 'en_us', 'Shining a Spotlight \r\non Family Needs', '<p>We’re always sharing new information and resources that help families stay on track while encouraging schools to be more responsive to student and parent needs. <a href=\"{entry:2830:url}\">Read more about what we’re learning</a>.</p>', '2017-01-25 20:35:32', '2017-01-26 16:38:33', '5605e04e-6f22-48f2-9e66-feb302566db1');
INSERT INTO `craft_matrixcontent_ourapproach` (`id`, `elementId`, `locale`, `field_step_stepTitle`, `field_step_stepContent`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '2918', 'en_us', 'Sign Up', '<p>You can register to become an EdNavigator member through your employer, a participating community organization, or our website. Members can receive help with their child’s education or with their own learning goals.</p>', '2017-01-25 20:35:32', '2017-01-26 16:38:33', '49ee6eab-88d4-4e43-a72d-4f0985cf7b11'),
 ('2', '2919', 'en_us', 'Review Records', '<p>After registering, you’ll be connected to a Navigator—if you’re a parent, we’ll work together to create a path to success for your child. If you’re an adult learner, we’ll get to work helping you further your education.</p>', '2017-01-25 20:35:32', '2017-01-26 16:38:33', '0c005e9a-2bd3-4ee3-b8eb-5fdbd5dd115b'),
 ('3', '2920', 'en_us', 'Make a Plan', '<p>Your Navigator will help you set clear short- and long-term goals, from getting your child into college to helping you get a degree while balancing work and life. Then together, you’ll create a concrete plan for achieving those goals.</p>', '2017-01-25 20:35:32', '2017-01-26 16:38:33', '7067ba26-8ed5-4a98-aa1e-c3f0f4efb504'),
 ('4', '2921', 'en_us', 'Take Action', '<p>Your Navigator will offer direct, hands-on assistance to help you turn your plans into reality—that may include going with you to school meetings, teaching effective study habits, or connecting you to available community resources.</p>', '2017-01-25 20:35:32', '2017-01-26 16:38:33', 'e59f90c5-6325-4ead-b2f7-8eebe118783b'),
 ('5', '2922', 'en_us', 'Stay on Track', '<p>As students progress, EdNavigator will be there every step of the way—whatever new challenges or opportunities arise, we’re here to support and keep our member families on track to reach their goals.</p>', '2017-01-25 20:35:32', '2017-01-26 16:38:33', 'eff221c5-fddf-4e28-828c-d21edd3d2736');
INSERT INTO `craft_matrixcontent_ournavigators` (`id`, `elementId`, `locale`, `field_navigatorsInfoSection_sectionTitle`, `field_navigatorsInfoSection_sectionContent`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '2916', 'en_us', 'Personal, Professional Guidance', '<p>Our Navigators combine expert knowledge of schools with a deep understanding of our communities. Most are accomplished former teachers, school leaders, or counselors, and all have passed a background check, received privacy training and adhere to a strict code of confidentiality. </p>\n<p>They’re like pediatricians for your educational health, and they’re always looking out for your best interests.</p>', '2017-01-25 20:35:32', '2017-01-26 16:38:33', '4ec20940-3b9b-450b-bafe-f4e6fd71ae8f'),
 ('2', '2917', 'en_us', 'Help that Finds You', '<p>Your Navigator will meet with you at your worksite—or wherever is most convenient for you—to develop a customized educational plan. They’ll help: </p>\n<ul><li>Set clear learning goals</li><li>Choose the right school and explore financial options</li><li>Communicate with teachers and administrators</li><li>Analyze grades and progress</li><li>Answer your questions via phone, text, or email whenever you need advice</li></ul>', '2017-01-25 20:35:32', '2017-01-26 16:38:33', '567c5b08-1aae-45ec-a3bc-2085e2e1fd52');
INSERT INTO `craft_matrixcontent_pathpagesections` (`id`, `elementId`, `locale`, `field_pageSection_sectionText`, `field_pageSection_sectionLinks`, `field_pageSection_sectionColor`, `field_pageSection_sectionTitle`, `field_pageSection_sectionTitleStyle`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '2881', 'en_us', 'Whether you are guiding a child through school or working towards your own educational goals, you can count on us to provide expert advice and personalized, hands-on support \r\nevery step of the way.', '<p><a href=\"{entry:2830:url}\">Learn more about Who We Are</a></p>', 'background-blue', 'Find your\r\npath.', 'regular', '2017-01-17 20:42:53', '2017-01-24 23:19:24', '324da5f9-6ffa-4ffd-aff3-d7398eaeb012'),
 ('2', '2881', 'es_us', 'Testing', '<p><a href=\"{entry:2830:url}\">Learn more about Who We Are</a></p>', 'background-blue', 'Español!', 'regular', '2017-01-17 20:42:53', '2017-01-24 23:19:24', '49382db5-e099-4f56-a4c8-8be5f102180d'),
 ('3', '2886', 'en_us', 'Our expert Navigators work with you to set clear goals, create a concrete plan, and take action. We can help you choose the right school, review and analyze academic progress, support learning at home and stand up for students’ needs in the classroom.', '<p><a href=\"{entry:2831:url}\">Learn more about How We Help</a></p>', 'background-gray', 'The help you\r\nneed, when you\r\nneed it.', 'regular', '2017-01-17 22:45:59', '2017-01-24 23:19:24', 'd6b1070b-b02e-4049-aca1-5869380c5980'),
 ('4', '2886', 'es_us', 'Our expert Navigators work with you to set clear goals, create a concrete plan, and take action. We can help you choose the right school, review and analyze academic progress, support learning at home and stand up for students’ needs in the classroom.', '<p><a href=\"{entry:2831:url}\">Learn more about How We Help</a></p>', 'background-gray', 'The help you need, when you need it.', 'regular', '2017-01-17 22:45:59', '2017-01-24 23:19:24', '167a5efe-91f9-42d0-95d1-7ce09eb49a5f'),
 ('5', '2891', 'en_us', 'An investment in your employees’ future is an investment in your business and community. EdNavigator offers employers an innovative way to boost employee morale, reduce turnover, and cut costs while improving educational outcomes for students and helping families, schools, and communities thrive.', '', 'background-gray', 'Invest in your \r\ngreatest asset \r\n— your people.', 'regular', '2017-01-17 23:12:01', '2017-01-24 23:19:24', 'd2e71021-f30d-410c-9bab-2be67ac081b9'),
 ('6', '2891', 'es_us', 'An investment in your employees’ future is an investment in your business and community. EdNavigator offers employers an innovative way to boost employee morale, reduce turnover, and cut costs while improving educational outcomes for students and helping families, schools, and communities thrive.', '', 'background-gray', 'Invest in your \r\ngreatest asset \r\n— your people.', 'regular', '2017-01-17 23:12:01', '2017-01-24 23:19:24', 'bdf5003b-f575-4f28-96da-6b4da81124f0'),
 ('7', '2896', 'en_us', 'Our Employer Partners bring EdNavigator support to the workplace as a benefit for employees. Our expert Navigators help parents keep students on track in school and adult learners in pursuit of their own educational dreams.', '<p><a href=\"{entry:2831:url}\">See how it works</a></p>', 'background-gold', 'Give back with \r\noutstanding \r\nsupport.', 'regular', '2017-01-17 23:35:21', '2017-01-24 23:19:24', 'f1271e99-d423-49db-9b57-ebdff7db46ba'),
 ('8', '2896', 'es_us', 'Our Employer Partners bring EdNavigator support to the workplace as a benefit for employees. Our expert Navigators help parents keep students on track in school and adult learners in pursuit of their own educational dreams.', '<p><a href=\"{entry:2831:url}\">See how it works</a></p>', 'background-gold', 'Give back with \r\noutstanding \r\nsupport.', 'regular', '2017-01-17 23:35:21', '2017-01-24 23:19:24', '24fbc6e9-3276-4503-9c70-62ad9d0fdcb2'),
