INSERT INTO `craft_matrixcontent_people` (`id`, `elementId`, `locale`, `field_person_personName`, `field_person_personTitle`, `field_person_personDescription`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('13', '2846', 'en_us', 'Timothy Daly', 'Founding Partner', '<p>Tim brings 17 years of experience in public education to EdNavigator, including service as an urban school teacher, organizational leader, and policy expert. Prior to founding EdNavigator, he served alongside Ariela Rozman as President of TNTP, a leading education nonprofit organization that partners with school systems and states to ensure that all students get excellent teachers. During his eight years in that role, TNTP became a leading source of innovative research and a respected independent voice on teacher quality issues. Before joining TNTP in 2001, Tim taught social studies at Northeast Middle School in Baltimore. He holds a MA in Teaching from Johns Hopkins University and a BA in American Studies from Northwestern University. He lives in Chicago with his wife and two children.</p>', '2016-12-20 22:40:44', '2017-01-30 22:23:15', '01f973fb-1b26-44ec-975c-d0dbe5f9ab43'),
 ('14', '2847', 'en_us', 'Whitney Henderson', 'Navigator-in-chief', '<p>A native of East St. Louis, IL, Whitney brings to her work 10 years of experience as an award-winning teacher, school principal and instructional expert. Her career in education began in New Orleans, where she moved after Hurricane Katrina to become a founding teacher and eventually 7th-9th grade principal at KIPP Central City Academy. Her extraordinary success with students earned her the 2011 Fishman Prize, a $25,000 award given annually to just four teachers nationwide. Whitney holds a BA in English and Modern Foreign Languages from Jackson State University, a MA in Organizational Leadership from Teacher’s College at Columbia University, and a Master’s in Education Policy and Management from the Harvard Graduate School of Education. She lives in New Orleans, LA. </p>', '2016-12-20 22:40:44', '2017-01-30 22:23:15', '09ec2bbe-d747-404f-8808-a604bdf1b306'),
 ('15', '2848', 'en_us', 'David Keeling', 'Founding Partner', '<p>David Keeling has 16 years of experience in strategic communications and public education. Over the last decade and a half, his words have appeared in teacher recruitment ads in the New York City subway, in news outlets from Education Week to The New York Times, and in the remarks and messages of some of the nation’s most prominent education leaders. Before EdNavigator, he served for six years as Vice President of Communications for TNTP, leading the organization’s communications, marketing and publications strategy and advising TNTP staff, state education agencies and urban school systems nationwide on communicating with teachers, parents, school leaders, and other stakeholders.  He holds a BA in English from Middlebury College and lives with his wife and two children in Chicago.</p>', '2016-12-20 22:40:44', '2017-01-30 22:23:15', 'a299d1e7-dd11-42e4-9eef-b16653c57ae4'),
 ('16', '2849', 'en_us', 'Ariela Rozman', 'Founding Partner', '<p>Before founding EdNavigator, Ariela Rozman served for eight years as Chief Executive Officer of TNTP. Under her tenure as CEO, TNTP tripled in size, growing to a staff of 370 full-time employees across 41 states and an annual budget of more than $60 million.  Today, TNTP has a presence in more than 50 cities and states, including most of the country’s largest urban areas. In 2012, she and then-TNTP President Tim Daly received the Harold W. McGraw, Jr. Prize in Education for their leadership. Prior to joining TNTP in 2001, Ariela worked in consulting for Bain &amp; Company and helped launch and grow the e-commerce site PlanetRx.com. She holds a BA in Political and Social Thought from the University of Virginia and lives in Brooklyn, NY with her husband and two children.</p>', '2016-12-20 22:40:44', '2017-01-30 22:23:15', 'fe7f02c7-20cb-4f40-9c18-bdf27d064f4c'),
 ('17', '2851', 'en_us', 'Kriste Dragon', 'Co-founder and Chief Executive Officer, Citizens of the World Charter Schools', '', '2016-12-20 22:49:44', '2017-01-30 23:19:39', '21e6614c-3466-4163-9f46-17bba659c0c5'),
 ('18', '2852', 'en_us', 'Kaya Henderson', 'Former Chancellor,  DC Public Schools', '', '2016-12-20 22:49:44', '2017-01-30 23:19:39', '7661d7da-ef2f-4e34-94c4-b03553b3dccd'),
 ('19', '2853', 'en_us', 'Ryan Smith', 'Executive Director,  Education Trust-West', '', '2016-12-20 22:49:44', '2017-01-30 23:19:39', '9e1d7647-ed8c-4729-ae8a-c52ae5990138'),
 ('20', '2854', 'en_us', 'Chris Stewart', 'Director of Outreach and External Affairs, Education Post', '', '2016-12-20 22:49:44', '2017-01-30 23:19:39', '102d84f0-b28d-4716-8c74-75aa7ec27e5f'),
 ('21', '2857', 'en_us', 'International House Hotel', 'Anchor Partner', '<p>International House Hotel is a luxury boutique hotel located in downtown New Orleans, with 117 rooms. EdNavigator support is available to any eligible employee who is interested. </p>', '2016-12-20 23:04:45', '2017-01-30 23:19:24', 'fae92c88-93a0-47de-bdcf-4c65127a55be'),
 ('22', '2858', 'en_us', 'The New Orleans marriott', '', '<p>Located on Canal Street, the New Orleans Marriott is the city’s second-largest hotel, with 1,330 rooms.</p>', '2016-12-20 23:04:45', '2017-01-30 23:19:24', 'f18d166d-ac4f-48ef-aa77-5a8911fcd6f8'),
