INSERT INTO `craft_matrixcontent_principles` (`id`, `elementId`, `locale`, `field_principle_principleLabel`, `field_principle_principleDescription`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '2929', 'en_us', 'You always come first', 'We always put the needs of families and students first. We represent no one’s interests but yours. Ever', '2017-01-26 20:14:15', '2017-01-26 23:47:39', 'ab25d968-b7b5-4247-aeac-5226fda9295d'),
 ('2', '2929', 'es_us', 'You always come first', 'We always put the needs of families and students first. We represent no one’s interests but yours. Ever', '2017-01-26 20:14:15', '2017-01-26 20:14:15', '1db228c4-3854-42bb-8301-1e3c6a087fc0'),
 ('3', '2931', 'en_us', 'We put you in charge', 'We provide guidance and honest advice, but you set the course. We never act without your permission or make choices for you. Our job is to help you get what you want. ', '2017-01-26 20:22:20', '2017-01-26 23:47:39', 'ffd67360-ef42-4ab5-a281-4f0ab21c4189'),
 ('4', '2931', 'es_us', 'We put you in charge', 'We provide guidance and honest advice, but you set the course. We never act without your permission or make choices for you. Our job is to help you get what you want. ', '2017-01-26 20:22:20', '2017-01-26 20:22:20', '2e4358ed-db43-4df0-806f-17cc5e5918e6'),
 ('7', '2937', 'en_us', 'We treat you like family', 'We share your sense of urgency. We respond quickly, take your concerns seriously, and always treat you with dignity and respect. Your problems are our problems.', '2017-01-26 23:47:39', '2017-01-26 23:47:39', '320b1270-0eaf-495c-a800-31b4955d94fe'),
 ('8', '2937', 'es_us', 'We treat you like family', 'We share your sense of urgency. We respond quickly, take your concerns seriously, and always treat you with dignity and respect. Your problems are our problems.', '2017-01-26 23:47:39', '2017-01-26 23:47:39', '9caae165-0aea-4171-b893-81a1f5b2fe02'),
 ('9', '2938', 'en_us', 'We find a way', 'We don’t let systems, processes, paperwork or unwritten rules get in the way of doing right by a family or student. We find a way to make it happen.', '2017-01-26 23:47:39', '2017-01-26 23:47:39', '35a20bf4-8b91-4db6-9c62-166c43cc1d33'),
 ('10', '2938', 'es_us', 'We find a way', 'We don’t let systems, processes, paperwork or unwritten rules get in the way of doing right by a family or student. We find a way to make it happen.', '2017-01-26 23:47:39', '2017-01-26 23:47:39', 'e3430ad0-abdc-440c-98b5-44377be9da3b'),
 ('11', '2939', 'en_us', 'We protect your privacy', 'We maintain best-in-class privacy controls to protect you. We never share information about you or your children without your consent. ', '2017-01-26 23:47:39', '2017-01-26 23:47:39', '406c9bb2-7aa8-4809-9c81-1fb122386f3c'),
 ('12', '2939', 'es_us', 'We protect your privacy', 'We maintain best-in-class privacy controls to protect you. We never share information about you or your children without your consent. ', '2017-01-26 23:47:39', '2017-01-26 23:47:39', '3701e132-7861-4427-be85-050789d2d2d0'),
 ('13', '2940', 'en_us', 'We level the playing field', 'We champion the right of all families to an excellent education, especially those who have faced disadvantages in the past.', '2017-01-26 23:47:39', '2017-01-26 23:47:39', 'd03702c0-aa8e-4a6b-b12d-26edbc387042'),
 ('14', '2940', 'es_us', 'We level the playing field', 'We champion the right of all families to an excellent education, especially those who have faced disadvantages in the past.', '2017-01-26 23:47:39', '2017-01-26 23:47:39', 'edddbe5e-0996-4b85-9b09-4c081437a806');
