nent education leaders before ednavigator he served for six years as vice president of communications for tntp leading the organization s communications marketing and publications strategy and advising tntp staff state education agencies and urban school systems nationwide on communicating with teachers parents school leaders and other stakeholders   he holds a ba in english from middlebury college and lives with his wife and two children in chicago david keeling founding partner before founding ednavigator ariela rozman served for eight years as chief executive officer of tntp under her tenure as ceo tntp tripled in size growing to a staff of 370 full time employees across 41 states and an annual budget of more than $60 million   today tntp has a presence in more than 50 cities and states including most of the country s largest urban areas in 2012 she and then tntp president tim daly received the harold w mcgraw jr prize in education for their leadership prior to joining tntp in 2001 ariela worked in consulting for bain company and helped launch and grow the e commerce site planetrx com she holds a ba in political and social thought from the university of virginia and lives in brooklyn ny with her husband and two children ariela rozman founding partner '),
